    def validate_year(value, min_year, max_year):
        return value.isdigit() and min_year <= int(value) <= max_year

    def validate_height(value):
        if value.endswith('cm'):
            height = int(value[:-2])
            return 150 <= height <= 193
        elif value.endswith('in'):
            height = int(value[:-2])
            return 59 <= height <= 76
        return False

    def validate_hair_color(value):
        return re.match('^#[0-9a-f]{6}$', value) is not None

    def validate_eye_color(value):
        return value in {'amb', 'blu', 'brn', '', 'grn', 'hzl', 'oth'}

    def validate_passport_id(value):
        return re.match('^\\d{9}$', value) is not None
    validations = {'byr': lambda x: validate_year(x, 1920, 2002), 'iyr': lambda x: validate_year(x, 2010, 2020), 'eyr': lambda x: validate_year(x, 2020, 2030), 'hgt': validate_height, 'hcl': validate_hair_color, 'ecl': validate_eye_color, 'pid': validate_passport_id}
    for (key, value) in passport_data.items():
        if key in validations and (not validations[key](value)):
            return False
    return True

